('CODEMIRROR', 33, 74, 20, '변경이벤트', 'obj_{G.GRPID}_{I.COLID}.on(\"change\", function(cm, change) {\n            console.log(\"cm change -------------------------------start\");\n            console.log(\"    cm.getValue :  (\" + obj_{G.GRPID}_{I.COLID}.getValue() + \")\");\n            console.log(\"    change.origin : (\" + change.origin + \")\");\n            console.log(\"    change.from : (\" + change.to + \")\");\n            console.log(\"    change.text : (\" + change.text + \")\");\n            console.log(\"    change.removed : (\" + change.removed + \")\");\n            console.log(\"    change.to : (\" + change.to + \")\");\n\n            //바인드 정보로 리턴하기\n            if(change.origin != \"setValue\"){\n                rid = mygrid{GF.GRPORD}.getSelectedId(); //{GF.GRPNM} 상위그리드\n                cidx = mygrid{GF.GRPORD}.getColIndexById(\"{I.COLID}\");\n                mygrid{GF.GRPORD}.cells(rid,cidx).setValue(cm.getValue());\n                mygrid{GF.GRPORD}.cells(rid,cidx).wasChanged = true;\n                mygrid{GF.GRPORD}.setRowTextBold(rid);\n            }\n\n        });\n       ', '', 'PGMINFOD.REF', '', 'R', NULL, 'N', '20140726144034', '20140726202518'),
