('FORMVIEW', 244, 334, 30, '', '				default:\n					//처리 결과 리턴\n					$rtnVal->RTN_CD = \"500\";\n					$rtnVal->ERR_CD = \"593\";\n					echo json_encode($rtnVal);\n					return;	\n			}\n\n			$tmpVal = makeFormviewSaveJson($FORMVIEW,$this->DB);\n			array_push($_RTIME,array(\"[TIME 50.DB_TIME {V.SVCGRPID}]\",microtime(true)));\n\n			$al->GRPID = $grpId;\n			array_push($rtnVal->GRP_DATA, $tmpVal);\n\n			//$rtnVal = makeFormviewSaveJson($FORMVIEW,$this->DB);\n\n		}//C,U 일때만 DB처리\n', '', '', '', 'R', '', '', '20171214225830', '20180323074917'),
('FORMVIEW', 197, 335, 10, 'FILE 있을때', '	var formview_data = $(\"#formview{V.GRPID}\").serializeArray();\n    $.each(formview_data,function(i,nmval){\n        formData.append(nmval.name,nmval.value);\n	});\n', '', '', '', 'R', 'V.IO_FILE_YN=Y', '', '20171218230944', '20171219224200'),
