('GRID', 510, 123, 40, 'max', '							//특정 컬럼 최대값 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								if( out < parseFloat(mygrid{G.GRPID}.cells2(i,ind).getValue()) ){\n									out = parseFloat(mygrid{G.GRPID}.cells2(i,ind).getValue());\n								}\n							}\n							//천단위 금액 표기\n							out = formatNumber(out);\n																			 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);', '', '', '', 'R', 'I.FOOTERMATH=MAX', '', '20180829081552', '20180829082031'),
('GRID', 510, 124, 30, 'min', '							//특정 컬럼 최소값 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								if( out > parseFloat(mygrid{G.GRPID}.cells2(i,ind).getValue()) ){\n									out = parseFloat(mygrid{G.GRPID}.cells2(i,ind).getValue());\n								}\n							}\n							//천단위 금액 표기\n							out = formatNumber(out);\n																			 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);', '', '', '', 'R', 'I.FOOTERMATH=MIN', '', '20180829081552', '20180829082031'),
('GRID', 510, 125, 20, 'avg', '							//특정 컬럼 평균 구하기. {G.GRPNM}.\n							var out = 0, ind=mygrid{G.GRPID}.getColIndexById(\"{I.COLID}\");\n							for(var i=0;i<mygrid{G.GRPID}.getRowsNum();i++){\n								out+= parseFloat(mygrid{G.GRPID}.cells2(i,ind).getValue())\n							}\n							out = Math.round(out/mygrid{G.GRPID}.getRowsNum());\n												 \n							$(\"#{G.GRPID}-{I.COLID}_SUM\").text(out);\n', '', '', '', 'R', 'I.FOOTERMATH=AVG', '', '20180829081552', '20180829082234');
