(38, 3, 38, 'insApi', '추가', 4, 'C', 'RTN_INT', 0, 'INSERT INTO APP_API(\n	API_NM, PGM_ID, URL, REQ_BODY, REQ_DATATYPE\n	, REQ_ENCTYPE, RES_BODY, MYFILE, MYFILESVRNM\n	, ADD_DT\n) VALUES (\n	#{F4-API_NM}, #{F4-PGM_ID}, #{F4-URL}, #{F4-REQ_BODY}, #{F4-REQ_DATATYPE}\n	,#{F4-REQ_ENCTYPE},#{F4-RES_BODY}, #{F4-MYFILE_name}, #{F4-MYFILE_svr_name}\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n) ', '20171206130109', '20180403082358'),
(39, 3, 20, 'fileC', 'FILE', 3, 'C', 'RTN_INT', 1, 'INSERT INTO CG_PJTFILE (\n	PJTSEQ, MKFILETYPE, MKFILETYPENM, MKFILEFORMAT, MKFILEEXT\n	, TEMPLATE, FILEORD, USEYN, ADDDT, ADDID\n) VALUES (\n	#{PJTSEQ}, #{MKFILETYPE}, #{MKFILETYPENM}, #{MKFILEFORMAT}, #{MKFILEEXT}\n	,#{TEMPLATE}, #{FILEORD}, #{USEYN}, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', '20171211112926', '20180329195438'),
