(95, 3, 56, 'selValidG', 'VALID', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n  0 as CHK, a.COLID,b.PGMSEQ,b.IOSEQ,a.VALIDSEQ AS DD_VALIDSEQ\n , b.VALIDSEQ AS IO_VALIDSEQ\n , b.ADDDT, b.MODDT\nFROM CG_DD a \n JOIN CG_PGMIO b on a.PJTSEQ = b.PJTSEQ and a.COLID = b.COLID\nwhere a.PJTSEQ = 3 anD a.VALIDSEQ != b.VALIDSEQ\nORDER BY COLID ASC', '20180325172446', '20180325172452'),
(96, 3, 56, 'updValidG', 'VALID', 3, 'U', 'RTN_INT', 0, 'update CG_PGMIO io JOIN CG_DD dd\n	on io.COLID = dd.COLID\n        and io.PJTSEQ = dd.PJTSEQ\nset\n        io.VALIDSEQ = dd.VALIDSEQ\n        ,io.MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere io.IOSEQ = #{IOSEQ}', '20180325172528', NULL),
(97, 3, 4, 'selMasG', 'MAS', 3, 'R', 'RTN_SELECT_LIST', 0, 'select \n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT,MODDT\nfrom \n	CG_CODE\norder by ORD asc', '20180325192036', '20180716172431'),
(98, 3, 4, 'selDtlG', 'DTL', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	CD,NM,CDDESC,PCD,ORD\n	,CDVAL,CDVAL2,CDMIN,CDMAX,DATATYPE\n	,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT,MODDT\nfrom CG_CODED\nwhere PCD = #{G2-PCD}\norder by ORD ', '20180325192242', '20180716172431'),
(99, 3, 4, 'insMasG', 'MAS', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODE (\n	PCD,PNM,PCDDESC,ORD\n	,UITOOL,USEYN,DELYN\n	,ADDDT\n) values (\n	#{PCD},#{PNM},#{PCDDESC},if(#{ORD}=\'\',\'10\',#{ORD})\n	,#{UITOOL},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', '20180325193702', '20180716172431'),
(100, 3, 4, 'insDtlG', 'DTL', 3, 'C', 'RTN_INT', 0, 'insert into CG_CODED (\n	CD,NM,CDDESC,PCD\n	,ORD,CDVAL,CDVAL2,CDMIN,CDMAX\n	,DATATYPE,EDITYN,FORMATYN,USEYN,DELYN\n	,ADDDT\n) values (\n	#{CD},#{NM},#{CDDESC},#{PCD}\n	,if(#{ORD}=\'\',10,#{ORD}),#{CDVAL},#{CDVAL2},#{CDMIN},#{CDMAX}\n	,#{DATATYPE},#{EDITYN},#{FORMATYN},if(#{USEYN}=\'\',\'Y\',#{USEYN}),if(#{DELYN}=\'\',\'N\',#{DELYN})\n	,date_format(sysdate(),\'%Y%m%d%H%i%s\')\n)', '20180325194215', '20180716172431'),
(101, 3, 4, 'updMasG', 'MAS', 3, 'U', 'RTN_INT', 0, 'update CG_CODE set\n	PNM = #{PNM}, PCDDESC = #{PCDDESC}, ORD = #{ORD}, UITOOL = #{UITOOL}, USEYN = #{USEYN}\n	, DELYN = #{DELYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere PCD = #{PCD}\n', '20180325195023', '20180716172431'),
(102, 3, 4, 'updDtlG', 'DTL', 3, 'U', 'RTN_INT', 0, 'update  CG_CODED set\n	NM = #{NM}, CDDESC = #{CDDESC},ORD = #{ORD}, CDVAL = #{CDVAL}, CDVAL2 = #{CDVAL2}\n	, CDMIN = #{CDMIN}, CDMAX = #{CDMAX}, DATATYPE = #{DATATYPE}, EDITYN = #{EDITYN}, FORMATYN = #{FORMATYN}\n	, USEYN = #{USEYN}, DELYN = #{DELYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere  PCD = #{PCD} and CD = #{CD}\n', '20180325195045', '20180716172431'),
(103, 3, 4, 'delDtlG', 'DTL', 3, 'D', 'RTN_INT', 0, 'delete from CG_CODED \nwhere PCD = #{PCD} and CD = #{CD}\n', '20180325200218', '20180716172431'),
(104, 3, 4, 'delMasG', 'MAS', 3, 'D', 'RTN_INT', 0, 'delete from CG_CODE\nwhere PCD = #{PCD} \n', '20180325200333', '20180716172431'),
(105, 3, 57, 'selIpG', 'IP', 4, 'R', 'RTN_SELECT_LIST', 0, 'select\n	IP_SEQ, PGMTYPE, IP, IP_DESC, ADD_DT, ADD_ID\n	, MOD_DT, MOD_ID \nfrom CMN_IP\norder by IP_SEQ desc ', '20180327073116', '20180329190352'),
(106, 3, 57, 'insIpG', 'IP', 4, 'C', 'RTN_INT', 0, 'INSERT INTO CMN_IP (\n	PGMTYPE, IP, IP_DESC, ADD_DT, ADD_ID\n) VALUES (	\n	#{PGMTYPE}, #{IP}, #{IP_DESC}, date_format(sysdate(),\'%Y%m%d%H%i%s\'),#{USER.SEQ}   \n)', '20180327073733', '20180329190527'),
(107, 3, 57, 'updIpG', 'IP', 4, 'U', 'RTN_INT', 0, 'UPDATE CMN_IP SET\n	PGMTYPE = #{PGMTYPE}, IP = #{IP}, IP_DESC = #{IP_DESC}\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\') , MOD_ID = #{USER.SEQ}\nWHERE IP_SEQ = #{IP_SEQ}\n', '20180327081823', '20180329191006'),
