(109, 3, 60, 'sLayoutG', 'LAYOUT', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	PJTSEQ, LAYOUTID, GRPCNT, USEYN, ADDDT, ADDID, MODDT, MODID\nFROM CG_LAYOUT\nWHERE LAYOUTID like if(#{G1-LAYOUTID}=\'\',\'%\',#{G1-LAYOUTID})', '20180401154207', '20180401175813'),
(110, 3, 60, 'uLayoutG', 'LAYOUT', 3, 'U', 'RTN_INT', 0, 'UPDATE CG_LAYOUT SET\n	GRPCNT = #{GRPCNT}, USEYN = #{USEYN}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), MODID = #{USER.SEQ}\nWHERE LAYOUTID = #{LAYOUTID} AND PJTSEQ = #{PJTSEQ}\n', '20180401154207', '20180401162631'),
(111, 3, 60, 'sLayoutDG', 'LAYOUTD', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	LAYOUTDSEQ, PJTSEQ, LAYOUTID, GRPID, REFGRPID\n	, ORD, GRPTYPE, GRPWIDTH, GRPHEIGHT, VBOX\n	, ADDDT, MODDT\nFROM CG_LAYOUTD\nWHERE LAYOUTID = #{G2-LAYOUTID}\n ', '20180401154233', '20180401173853'),
(112, 3, 60, 'uLayoutDG', 'LAYOUTD', 3, 'U', 'RTN_INT', 0, 'UPDATE  CG_LAYOUTD SET \n	LAYOUTID = #{LAYOUTID}, GRPID = #{GRPID}, REFGRPID = #{REFGRPID}\n	, ORD = #{ORD}, GRPTYPE = #{GRPTYPE}, GRPWIDTH = #{GRPWIDTH}, GRPHEIGHT = #{GRPHEIGHT}, VBOX = #{VBOX}\n	, MODDT = date_format(sysdate(),\'%Y%m%d%H%i%s\'), ADDID = #{USER.SEQ}\nWHERE LAYOUTDSEQ = #{LAYOUTDSEQ} AND PJTSEQ = #{PJTSEQ}\n', '20180401154317', '20180401160710'),
(113, 3, 60, 'iLayoutG', 'LAYOUT', 3, 'C', 'RTN_INT', 0, 'INSERT INTO CG_LAYOUT (\n	PJTSEQ, LAYOUTID, GRPCNT\n	, ADDDT, ADDID\n) VALUES (\n	#{PJTSEQ}, #{LAYOUTID}, #{GRPCNT}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', '20180401161539', NULL),
(114, 3, 60, 'iLayoutDG', 'LAYOUTD', 3, 'C', 'RTN_INT', 0, 'INSERT INTO CG_LAYOUTD (\n	PJTSEQ, LAYOUTID, GRPID, REFGRPID, ORD\n	, GRPTYPE, GRPWIDTH, GRPHEIGHT, VBOX\n	, ADDDT, ADDID\n) VALUES (\n	#{PJTSEQ}, #{LAYOUTID}, #{GRPID}, #{REFGRPID}, #{ORD}\n	, #{GRPTYPE}, #{GRPWIDTH}, #{GRPHEIGHT}, #{VBOX}\n	, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', '20180401161557', '20180401161724'),
(115, 3, 60, 'dLayoutG', 'LAYOUTD', 3, 'D', 'RTN_INT', 0, 'DELETE FROM CG_LAYOUT WHERE LAYOUTID = #{LAYOUTID}', '20180401162121', '20180401162336'),
