(117, 3, 61, 'selPjtG', 'PJT', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT PJTSEQ,PJTID,PJTNM FROM CG_PJTINFO', '20180405215405', '20180406072951'),
(118, 3, 61, 'selPgmG', 'PGM', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT PGMID,PGMNM,ADDDT,MODDT FROM CG_PGMINFO WHERE PJTSEQ = #{G2-PJTSEQ}', '20180405215503', '20180405215544'),
(119, 3, 62, 'sSqlF', 'sql', 3, 'R', 'RTN_SELECT_ONE', 0, 'SELECT \n	SQLID, SQLTXT\nFROM \n	CG_PGMSQL\nWHERE PJTSEQ = #{G3-PJTSEQ} \n	AND PGMSEQ = #{G3-PGMSEQ} \n	AND SQLSEQ = #{G3-SQLSEQ}', '20180423150802', '20180423150920'),
(120, 3, 62, 'sSqlG', 'sql', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	PJTSEQ, PGMSEQ, SQLSEQ, SQLID, SQLNM\n	, CRUD, RTN_TYPE, ADDDT\nFROM \n	CG_PGMSQL\nWHERE PJTSEQ = #{G2-PJTSEQ} AND PGMSEQ = #{G2-PGMSEQ}\n', '20180423150802', '20180423150920'),
(121, 3, 62, 'sPgmG', 'pgm', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	PJTSEQ,PGMSEQ,PGMID,PGMNM,ADDDT\nFROM \n	CG_PGMINFO\nWHERE PJTSEQ = #{G1-PJTSEQ}', '20180423150802', '20180423150920'),
(122, 3, 63, 'sLoginG', 'login', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LOGIN_SEQ, USR_ID, SESSION_ID, SUCCESS_YN, RESPONSE_MSG\n	, PW_ERR_CNT, LOCKCD, USR_SEQ, SERVER_NAME, REMOTE_ADDR\n	, USER_AGENT, ADD_DT\nFROM CMN_LOG_LOGIN\nWHERE USR_ID = #{USER.ID}\nORDER BY LOGIN_SEQ DESC', '20180423152901', '20180426090831'),
(123, 3, 63, 'sLockG', 'lock', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LOGIN_SEQ, USR_ID, SESSION_ID, SUCCESS_YN, LOCKCD, PW_ERR_CNT, LOCK_LIMIT_DT\n	, USR_SEQ, ADD_DT\nFROM CMN_LOG_LOGIN\nWHERE LOCKCD IN (\'GOLOCK\',\'UNLOCK\')\n	AND USR_ID = #{USER.ID}\nORDER BY LOGIN_SEQ DESC', '20180423152901', NULL),
(124, 3, 63, 'sMenuG', 'menu', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT\n	LAUTH_SEQ, REQ_TOKEN, RES_TOKEN, USR_SEQ, USR_ID\n	, PGMID, AUTH_ID, SUCCESS_YN, ADD_DT\nFROM CMN_LOG_AUTH\nWHERE USR_ID = #{USER.ID}\nORDER BY LAUTH_SEQ DESC', '20180423152901', NULL),
(125, 3, 65, 'sLgnFailG', 'sLgnFailG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by USR_ID ORDER BY count(login_seq) desc', '20180511142644', NULL),
(126, 3, 65, 'sLgnIpG', 'sLgnIpG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT REMOTE_ADDR, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE SUCCESS_YN = \'N\'\nGROUP by REMOTE_ADDR ORDER BY count(login_seq) desc', '20180511142716', NULL),
(127, 3, 65, 'sAuthNoG', 'sAuthNoG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID,count(LAUTH_SEQ) as AUTH_CNT\nFROM `CMN_LOG_AUTH` \nWHERE SUCCESS_YN = \'N\'\nGROUP BY USR_ID\nORDER BY count(LAUTH_SEQ) desc', '20180511142741', NULL),
(128, 3, 65, 'sLgnLockG', 'sLgnLockG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT USR_ID, count(LOGIN_SEQ) as LOGIN_CNT \nFROM CMN_LOG_LOGIN\nWHERE LOCKCD in (\'GOLOCK\')\nGROUP by USR_ID ORDER BY count(login_seq) desc ', '20180511142804', NULL),
(129, 3, 65, 'sAuthPiG', 'sAuthPiG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT b.USR_ID,count(a.LAUTHD_SEQ) as REQ_PI_CNT,sum(a.ROW_CNT) as VIEW_ROW_SUM \nFROM CMN_LOG_AUTHD a\n	JOIN CMN_LOG_AUTH b ON a.REQ_TOKEN = b.REQ_TOKEN\nWHERE PI_IN_COLIDS != \'\' AND PI_IN_COLIDS is not NULL\nGROUP BY b.USR_ID\nORDER BY count(a.ROW_CNT) desc', '20180511142828', NULL),
(130, 3, 65, 'iMonthG', 'iMonthG', 4, 'C', 'RTN_INT', 0, 'INSERT INTO CMN_LOG_CFM (\n	FROM_DT, TO_DT, CFM_DESC, ADD_DT, ADD_ID \n) VALUES (\n	replace(#{G2-FROM_DT},\'.\',\'\'), replace(#{G2-TO_DT},\'.\',\'\'), #{G2-CFM_DESC}, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', '20180511142906', '20180511150351'),
(131, 3, 65, 'sMonthG', 'sMonthG', 4, 'R', 'RTN_SELECT_ONE', 0, 'SELECT #{G1-FROM_DT} as FROM_DT, #{G1-TO_DT} as TO_DT', '20180511142946', '20180511150155'),
(132, 3, 65, 's2MonthG', 's2MonthG', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n	CFM_SEQ, FROM_DT, TO_DT, CFM_DESC, ADD_DT\n	, ADD_ID\nFROM CMN_LOG_CFM\nORDER BY CFM_SEQ DESC', '20180511143012', NULL),
(133, 3, 66, 'sLogin', 'LOGIN', 4, 'R', 'RTN_SELECT_LIST', 0, 'SELECT substring(add_dt,1,8) as LOGIN_DT\n	, count(login_seq) as LOGIN_CNT \n	, count(login_seq)+10 as LOGIN_CNT2\nFROM CMN_LOG_LOGIN\nGROUP BY substring(add_dt,1,8)\nORDER BY substring(add_dt,1,8)\n', '20180515205842', '20180524081848'),
(134, 3, 67, 'sPgmG', 'PGM', 3, 'R', 'RTN_SELECT_LIST', 0, 'SELECT \n        0 as CHK, PGMSEQ, PGMID, PGMNM, PKGGRP, VIEWURL, PGMTYPE, SECTYPE, ADDDT, MODDT\n    FROM \n        CG.CG_PGMINFO\n    WHERE PJTSEQ = #{G1-PJTSEQ}\n', '20180528073431', '20180528080545'),
(135, 3, 67, 'sAuthG', 'AUTH', 3, 'R', 'RTN_SELECT_LIST', 0, '  SELECT \n 		0 as CHK\n		, concat(p.PGMID,\'-\',g.GRPID,\'_\',f.FNCID) as ROWID\n      ,p.PGMID \n      ,concat(g.GRPID,\'_\',f.FNCID) as AUTH_ID\n      ,concat(g.GRPNM,\'_\',f.FNCNM) as AUTH_NM \n  FROM \n      CG.CG_PGMGRP g\n      JOIN CG.CG_PGMFNC f on g.GRPSEQ = f.GRPSEQ and g.PGMSEQ = f.PGMSEQ\n      JOIN CG.CG_PGMINFO p on p.PGMSEQ = g.PGMSEQ\n  WHERE p.PJTSEQ = #{G1-PJTSEQ} AND ( f.FNCTYPE != \'\' && f.FNCTYPE is not null )\n      order by p.PGMID,g.GRPORD asc,f.FNCORD asc  \n', '20180528073504', '20180528080545'),
(136, 3, 67, 'sFileG', 'FILE', 3, 'R', 'RTN_SELECT_LIST', 0, '    SELECT \n        0 as CHK, PGMSEQ, VERSEQ, FILESEQ, FILETYPE, FILENM, FILEHASH, FILESIZE, ADDDT, MODDT\n    FROM \n        CG.CG_RSTFILE\n    WHERE PJTSEQ = #{G1-PJTSEQ} and ACTIVEYN = \'Y\'\n', '20180528073504', '20180528081305'),
(137, 3, 68, 'sToCFG', 'ToCfg', 3, 'R', 'RTN_SELECT_LIST', 10, 'select \n PJTSEQ,CFGSEQ,USEYN,CFGID,CFGNM,MVCGBN,PATH,CFGORD,ADDDT,MODDT\nfrom CG_PJTCFG\nwhere PJTSEQ = #{G1-TO_PJTSEQ} ', '20180712171348', '20180712171613'),
(138, 3, 68, 'sFromCFG', 'FromCfg', 3, 'R', 'RTN_SELECT_LIST', 10, 'select \n 0 as CHKEDIT,PJTSEQ,CFGSEQ,USEYN,CFGID,CFGNM,MVCGBN,PATH,CFGORD,ADDDT,MODDT\nfrom CG_PJTCFG\nwhere PJTSEQ = #{G1-FROM_PJTSEQ} \n', '20180712171348', '20180712172845'),
(139, 3, 68, 'sFromFile', 'FromFile', 3, 'R', 'RTN_SELECT_LIST', 10, 'SELECT \n 0 as CHKEDIT, PJTSEQ,FILESEQ,MKFILETYPE,MKFILETYPENM,MKFILEFORMAT,MKFILEEXT,TEMPLATE,FILEORD,USEYN,ADDDT,MODDT\nFROM CG_PJTFILE\nWHERE PJTSEQ = #{G1-FROM_PJTSEQ}\n', '20180712171511', '20180712172845'),
(140, 3, 68, 'sToFile', 'ToFile', 3, 'R', 'RTN_SELECT_LIST', 10, 'SELECT PJTSEQ,FILESEQ,MKFILETYPE,MKFILETYPENM,MKFILEFORMAT,MKFILEEXT,TEMPLATE,FILEORD,USEYN,ADDDT,MODDT\nFROM CG_PJTFILE\nWHERE PJTSEQ = #{G1-TO_PJTSEQ}\n', '20180712171511', '20180712171613'),
(141, 3, 68, 'iFromFile', 'CopyFile', 3, 'U', 'RTN_INT', 0, 'INSERT INTO CG_PJTFILE (\n	PJTSEQ, MKFILETYPE, MKFILETYPENM, MKFILEFORMAT, MKFILEEXT\n	, TEMPLATE, FILEORD, USEYN, ADDDT, ADDID\n) VALUES (\n	#{G1-TO_PJTSEQ}, #{MKFILETYPE}, #{MKFILETYPENM}, #{MKFILEFORMAT}, #{MKFILEEXT}\n	,#{TEMPLATE}, #{FILEORD}, #{USEYN}, date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n)', '20180712173131', '20180712173312'),
(142, 3, 68, 'iFromCFG', 'CopyCFG', 3, 'U', 'RTN_INT', 0, 'insert into CG_PJTCFG (\n PJTSEQ, CFGID, CFGNM, MVCGBN, PATH\n , CFGORD, USEYN\n , ADDDT, ADDID\n) values (\n #{G1-TO_PJTSEQ}, #{CFGID}, #{CFGNM}, #{MVCGBN}, #{PATH}\n , #{CFGORD}, #{USEYN}\n , date_format(sysdate(),\'%Y%m%d%H%i%s\'), #{USER.SEQ}\n) \n', '20180712173311', NULL),
(143, 3, 71, 'sPjtList', 'PJT', 3, 'R', 'RTN_SELECT_LIST', 0, 'select\n	PJTSEQ,PJTID,PJTNM,FILECHARSET,UITOOL\n	,SVRLANG,DEPLOYKEY,PKGROOT,STARTDT,ENDDT\n	,DELYN,ADDDT,MODDT \nfrom\n CG_PJTINFO	\nwhere DELYN = \'N\'\n', '20180716171228', '20180716171445'),
(144, 24, 70, 'sLoadD', 'LOADD', 5, 'R', 'RTN_SELECT_LIST', 0, 'select\n	LOADD_SEQ, LOAD_SEQ ,TYPE, PRIORITY, CLASSNAME, \n	CLASS_LINE_S, CLASS_LINE_E, SOURCEFILE, SOURCEPATH, METHOD_NAME\n	, METHOD_LINE_S, METHOD_LINE_E, FIELD_NAME, FIELD_LINE_S, FIELD_LINE_E\n	, LINE_CNT, BUG_LINE_S, ADD_DT\nfrom\n	FILELOADD\nwhere LOAD_SEQ = #{G2-LOAD_SEQ}\norder by LOADD_SEQ desc', '20180716173205', '20180719095320'),
(145, 24, 70, 'sLoad', 'LOAD', 5, 'R', 'RTN_SELECT_LIST', 0, 'select \n	0 as CHK, LOAD_SEQ, FILE_NM, TEAM_NM, length(TEAM_NM) as TEAM_NM_LEN\n	, SYS_NM, length(SYS_NM) as SYS_NM_LEN, SUBSYS_NM, length(ifnull(SUBSYS_NM,\'\')) as SUBSYS_NM_LEN, FILE_HASH\n	, XML_VERSION, XML_TIMESTAMP, XML_ANAL_TIMESTAMP, XML_DT, XML_ANAL_DT\n	, BUG_CNT, LOAD_END_DT\n	, ADD_DT, MOD_DT\nfrom \n	FILELOAD\nwhere file_nm like concat(\'%\',#{G1-FILE_NM},\'%\') \n	and team_nm like  concat(\'%\',#{G1-TEAM_NM},\'%\') \n	and CASE\n          WHEN #{G1-ADD_DT} <>\'\' THEN ADD_DT like concat(\'%\',#{G1-ADD_DT},\'%\')\n          ELSE 1=1	\n	END\norder by LOAD_SEQ desc\n\n', '20180716173205', '20180719140649'),
(146, 24, 72, 'sList', 'sList', 5, 'R', 'RTN_SELECT_LIST', 0, 'select\n	VUL_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, FILE_NM\n	, RULESET_ID, SOURCEPATH, PRIORITY, VUL_CNT, ADD_DT\n	, MOD_DT\nfrom VULINFO\nwhere TEAM_NM like concat(\'%\',#{G1-TEAM_NM},\'%\')\norder by VUL_SEQ desc', '20180716181854', '20180718105411'),
(147, 24, 72, 'uList', 'uList', 5, 'U', 'RTN_SELECT_LIST', 0, 'update VULINFO\nset \n	TEAM_NM = #{TEAM_NM}, SYS_NM = #{SYS_NM}, SUBSYS_NM = #{SUBSYS_NM},\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\') \nwhere VUL_SEQ = #{VUL_SEQ}\n', '20180718105727', NULL),
(148, 24, 70, 'dLoad', 'LOAD', 5, 'D', 'RTN_INT', 0, 'delete from FILELOAD where LOAD_SEQ = #{LOAD_SEQ}', '20180719095320', NULL),
(149, 24, 70, 'uLoad', 'LOAD', 5, 'U', 'RTN_INT', 0, 'update FILELOAD\nset \n	TEAM_NM = #{TEAM_NM}\n	, SYS_NM = #{SYS_NM}\n	, SUBSYS_NM = #{SUBSYS_NM}\n	, MOD_DT = date_format(sysdate(),\'%Y%m%d%H%i%s\')\nwhere LOAD_SEQ = #{LOAD_SEQ}', '20180719103616', '20180719105021'),
(150, 24, 69, 'sTeam', 'TEAM', 5, 'R', 'RTN_SELECT_LIST', 0, 'select uuid() as UUID_SEQ, c.TEAM_NM\n, sum( case when priority = 1 then 1 else 0 end ) as PRIORITY_1\n, sum( case when priority = 2 then 1 else 0 end ) as PRIORITY_2\n, sum( case when priority = 3 then 1 else 0 end ) as PRIORITY_3\n, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	TEAMINFO c\n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc', '20180719144446', '20180822074138'),
(151, 24, 69, 'sSys', 'SYS', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM,SYS_NM, SUBSYS_NM, count(b.LOADD_SEQ) as VUL_CNT\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM  = #{G3-TEAM_NM}\ngroup by TEAM_NM, SYS_NM, SUBSYS_NM\norder by count(b.LOADD_SEQ) desc', '20180719154513', '20180720082950'),
(152, 24, 69, 'sRule', 'RULESET', 5, 'R', 'RTN_SELECT_LIST', 0, 'select UUID() as UUID_SEQ, TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE as RULESET, count(b.LOADD_SEQ) as vul_cnt\nfrom \n	FILELOAD a \n    join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere a.TEAM_NM = #{G4-TEAM_NM} and \n 	case \n		when #{G4-SUBSYS_NM} = \'\' then \n 			a.SUBSYS_NM  = \'\' or a.SUBSYS_NM is null\n		else a.SUBSYS_NM = #{G4-SUBSYS_NM}\n	end \n	and a.SYS_NM = #{G4-SYS_NM} \ngroup by TEAM_NM, SYS_NM, SUBSYS_NM, b.TYPE\norder by count(b.LOADD_SEQ) desc', '20180719154906', '20180719164116'),
(153, 24, 69, 'sTeamChart', 'TEAM', 5, 'R', 'RTN_SELECT_LIST', 0, 'select c.TEAM_NM, count(distinct b.type) as TYPE_CNT, ifnull(count(b.LOADD_SEQ),0) as VUL_CNT\nfrom \n	TEAMINFO c \n	left outer join FILELOAD a on c.TEAM_NM = a.TEAM_NM\n    left outer join  FILELOADD b on a.load_seq = b.LOAD_SEQ\nwhere \ncase when #{G1-EX_TEAM_NM} <> \'\' then c.TEAM_NM <> #{G1-EX_TEAM_NM} \n	else\n		1=1\n	end\ngroup by c.TEAM_NM\norder by ifnull(count(b.LOADD_SEQ),0) desc', '20180719155451', '20180720083033'),
